import React, { PureComponent } from 'react'

class Posts extends PureComponent {
    constructor(props) {
        super(props)

        this.state = {
            posts : Object.values(this.props) 
        }
    }

    render() {
        return (
            <Layout>
                
            {
                 this.state.posts.map((post, i) => (
                     <div  key={i} >
                     <h3 >{post.title} </h3>
                     <p >{post.body} </p>
                     </div>
                 ))
             }
            
           </Layout>
        )
    }
}

export default Posts
